import React from "react";
import { withStyles } from "@material-ui/core/styles";
import "./main.css";

const styles = theme => ({
  root: {
    background: "no-repeat fixed center"
  }
});

function About() {
  return (
    <div className={classes.root}>
      <h1>Hello World</h1>
    </div>
  );
}

export default withStyles(styles)(About);
